import React from 'react';
import { Link } from 'react-router-dom';

function HomePage() {
  return (
    <div>
      <h1>Welcome to Job Connector</h1>
      <nav>
        <Link to="/job-seekers">Job Seekers</Link>
        <Link to="/employers">Employers</Link>
      </nav>
    </div>
  );
}

export default HomePage;
